import argparse
import json
import os
import time

from time_agnostic_library.agnostic_query import VersionQuery


def parse_results_file(file_path):
    results = {}
    with open(file_path, 'r', encoding='utf8') as file:
        for line in file:
            if line.startswith("[Solution in version"):
                version_info, url_description = line.split(']', 1)
                version = int(version_info.split()[3])  # Estrai il numero di versione
                url, description = url_description.split('>', 1)
                url = url.strip('<').strip()
                description = description.strip()

                if version not in results:
                    results[version] = set()
                results[version].add((url, description))
    return results

def compare_results(query_result, result_expected):
    query_result_set = next(iter(query_result.values()))
    missing = result_expected - query_result_set
    additional = query_result_set - result_expected
    if not missing and not additional:
        return True, {}
    else:
        return False, {'missing': missing, 'additional': additional}

def run_benchmark(query_file_path, query_results_folder, timestamp, key, config_path):
    with open(query_file_path, 'r') as file:
        queries = file.readlines()

    # Dizionario per conservare i risultati
    results = {}

    for i, query_string in enumerate(queries):
        result_file_path = os.path.join(query_results_folder, f"mat-p-queries-{i+1}.txt")
        version = int(key)
        result_expected = parse_results_file(result_file_path)[version]
        formatted_query = format_query(query_string)
        start = time.time()
        agnostic_query = VersionQuery(query=formatted_query, on_time=(timestamp, timestamp), config_path=config_path)
        query_result = agnostic_query.run_agnostic_query()[0]
        end = time.time()
        comparison_result = compare_results(query_result, result_expected)
        results[query_string] = {
            'filename': os.path.splitext(os.path.basename(query_file_path))[0],  # Nome del file senza estensione
            'version': version,
            'timestamp_value': timestamp,
            'duration': end - start,
            'result': query_result,
            'comparison': comparison_result
        }
    return results

def format_query(raw_query):
    return f"SELECT * WHERE {{ {raw_query.strip()} }}"

def main(query_folder, query_results_folder, timestamp_path, config_path, result_path):
    with open(timestamp_path, "r") as file:
        timestamps = json.load(file)

    all_results = {}
    for file_name in os.listdir(query_folder):
        if file_name.endswith('.txt'):
            query_file_path = os.path.join(query_folder, file_name)
            for key, timestamp in timestamps.items():
                results = run_benchmark(query_file_path, query_results_folder, timestamp, key, config_path)
                all_results.update(results)

    with open(result_path, "w") as outfile:
        json.dump(all_results, outfile, indent=4)

if __name__ == "__main__":
    parser = argparse.ArgumentParser(description="Run a SPARQL benchmark test")
    parser.add_argument('query_folder', type=str, help="Folder containing SPARQL query files")
    parser.add_argument('query_results_folder', type=str, help="Path to the folder containing query results")
    parser.add_argument('timestamp_path', type=str, help="Path to the JSON file with timestamps")
    parser.add_argument('config_path', type=str, help="Path to the configuration JSON file")
    parser.add_argument('result_path', type=str, help="Path where to save the results JSON file")
    
    args = parser.parse_args()
    main(args.query_folder, args.query_results_folder, args.timestamp_path, args.config_path, args.result_path)

